DROP DATABASE IF EXISTS `db_annp`;
CREATE DATABASE `db_annp`;
CREATE TABLE `db_annp`.`meet` (`city` VARCHAR(25), `name` VARCHAR(75), `name.en` VARCHAR(75), `course` VARCHAR(25), `deadline` VARCHAR(25), `entrystartdate` VARCHAR(25), `entrytype` VARCHAR(25), `organizer` VARCHAR(50), `result.url` VARCHAR(75), `startmethod` VARCHAR(25), `timing` VARCHAR(25), `type` VARCHAR(25), `withdrawuntil` VARCHAR(25), `nation` VARCHAR(25), `maxentriesathlete` VARCHAR(25), `number` VARCHAR(25), `organizer.url` VARCHAR(50), `meetid` INT NOT NULL,PRIMARY KEY (`meetid`));
-- CREATE TABLE `db_annp`.`agedate` (`value` VARCHAR(25), `type` VARCHAR(25), `meetid` INT, `agedateid` INT NOT NULL,PRIMARY KEY (`agedateid`));
CREATE TABLE `db_annp`.`pool` (`name` VARCHAR(50), `lanemin` VARCHAR(25), `lanemax` VARCHAR(25), `meetid` INT, `poolid` INT NOT NULL,PRIMARY KEY (`poolid`));
-- CREATE TABLE `db_annp`.`facility` (`city` VARCHAR(25), `name` VARCHAR(50), `nation` VARCHAR(25), `meetid` INT, `facilityid` INT NOT NULL,PRIMARY KEY (`facilityid`));
-- CREATE TABLE `db_annp`.`pointtable` (`name` VARCHAR(50), `version` VARCHAR(25), `meetid` INT, `pointtableid` INT NOT NULL,PRIMARY KEY (`pointtableid`));
-- CREATE TABLE `db_annp`.`contact` (`email` VARCHAR(25), `name` VARCHAR(25), `meetid` INT, `city` VARCHAR(25), `phone` VARCHAR(25), `street` VARCHAR(25), `street2` VARCHAR(25), `zip` VARCHAR(25), `contactid` INT NOT NULL,PRIMARY KEY (`contactid`));
-- CREATE TABLE `db_annp`.`qualify` (`from` VARCHAR(25), `until` VARCHAR(25), `conversion` VARCHAR(25), `meetid` INT, `qualifyid` INT NOT NULL,PRIMARY KEY (`qualifyid`));
CREATE TABLE `db_annp`.`session` (`date` VARCHAR(25), `daytime` VARCHAR(25), `name` VARCHAR(25), `number` VARCHAR(25), `warmupfrom` VARCHAR(25), `warmupuntil` VARCHAR(25), `meetid` INT, `endtime` VARCHAR(25), `sessionid` INT NOT NULL,PRIMARY KEY (`sessionid`));
CREATE TABLE `db_annp`.`event` (`daytime` VARCHAR(25), `gender` VARCHAR(25), `number` VARCHAR(25), `order` VARCHAR(25), `round` VARCHAR(25), `preveventid` VARCHAR(25), `sessionid` INT, `type` VARCHAR(25), `eventid` INT NOT NULL,PRIMARY KEY (`eventid`));
CREATE TABLE `db_annp`.`swimstyle` (`distance` VARCHAR(25), `relaycount` VARCHAR(25), `stroke` VARCHAR(25), `eventid` INT, `swimstyleid` INT NOT NULL,PRIMARY KEY (`swimstyleid`));
-- CREATE TABLE `db_annp`.`fee` (`currency` VARCHAR(25), `value` VARCHAR(25), `eventid` INT, `timestandardrefid` INT, `feeid` INT NOT NULL,PRIMARY KEY (`feeid`));
-- CREATE TABLE `db_annp`.`agegroup` (`agemax` VARCHAR(25), `agemin` VARCHAR(25), `calculate` VARCHAR(25), `eventid` INT, `name` VARCHAR(25), `agegroupid` INT NOT NULL,PRIMARY KEY (`agegroupid`));
-- CREATE TABLE `db_annp`.`ranking` (`order` VARCHAR(25), `place` VARCHAR(25), `resultid` VARCHAR(25), `agegroupid` INT, `rankingid` INT NOT NULL,PRIMARY KEY (`rankingid`));
-- CREATE TABLE `db_annp`.`heat` (`daytime` VARCHAR(25), `number` VARCHAR(25), `order` VARCHAR(25), `status` VARCHAR(25), `eventid` INT, `heatid` INT NOT NULL,PRIMARY KEY (`heatid`));
-- CREATE TABLE `db_annp`.`timestandardref` (`timestandardlistid` VARCHAR(25), `eventid` INT, `timestandardrefid` INT NOT NULL,PRIMARY KEY (`timestandardrefid`));
CREATE TABLE `db_annp`.`club` (`type` VARCHAR(25), `code` VARCHAR(25), `nation` VARCHAR(25), `region` VARCHAR(25), `name` VARCHAR(50), `meetid` INT, `shortname` VARCHAR(25), `swrid` VARCHAR(25), `name.en` VARCHAR(25), `clubid` INT NOT NULL,PRIMARY KEY (`clubid`));
CREATE TABLE `db_annp`.`athlete` (`firstname` VARCHAR(50), `lastname` VARCHAR(25), `birthdate` VARCHAR(25), `gender` VARCHAR(25), `nation` VARCHAR(25), `license` VARCHAR(25), `swrid` VARCHAR(25), `clubid` INT, `athleteid` INT NOT NULL,PRIMARY KEY (`athleteid`));
CREATE TABLE `db_annp`.`result` (`eventid` VARCHAR(25), `points` VARCHAR(25), `swimtime` VARCHAR(25), `heatid` VARCHAR(25), `lane` VARCHAR(25), `entrytime` VARCHAR(25), `entrycourse` VARCHAR(25), `athleteid` INT, `status` VARCHAR(25), `relayid` INT, `late` VARCHAR(25), `comment` VARCHAR(150), `reactiontime` VARCHAR(25), `resultid` INT NOT NULL,PRIMARY KEY (`resultid`));
CREATE TABLE `db_annp`.`split` (`distance` VARCHAR(25), `swimtime` VARCHAR(25), `resultid` INT, `splitid` INT NOT NULL,PRIMARY KEY (`splitid`));
-- CREATE TABLE `db_annp`.`relay` (`agemax` VARCHAR(25), `agemin` VARCHAR(25), `agetotalmax` VARCHAR(25), `agetotalmin` VARCHAR(25), `gender` VARCHAR(25), `number` VARCHAR(25), `clubid` INT, `relayid` INT NOT NULL,PRIMARY KEY (`relayid`));
